Soil benchmarks of the Saarland, as of 2016 is a summarised data set of the expert committees of the Saarland. The ground benchmark (Section 196(1) BauGB) is the average position value of the soil for a majority of land within a defined area (soil benchmark zone), which largely correspond according to their land characteristics, in particular by type and degree of usability, and for which essentially the same general value ratios exist. It is related to the square meter of land area of a plot with the shown land characteristics (ground benchmark property). It is regularly determined and published by the review committees from the purchase price collection. The publication of the land benchmarks was made possible by the cooperation of the expert committees and the central office of the appraiser committees for land values of the Saarland at lcf. Attributes:
— State of development;
— Construction method;
— Number of floors;
— Number of floor areas relevant to value;
— Surface area;
— Depth;
— Wide;

