— scope of study which corresponds to the envelope in which the hazards were studied.

Consult the latest 20 news items from the city.gent website.
Need more news?
You can query the entire dataset as Linked Open Data.
For these surveys you use the RDF search language SPARQL.


Read more about Linked Open Data


View the structure of the RDF dataset with all news items


Use the example SPARQL query on the news items:

PREFIX dcat: &lt;http://www.w3.org/ns/dcat#&gt;
PREFIX schedule: &lt;http://schema.org/&gt;
SELECT ?news item ?subjectpage ?title ?content ?publication date
FROM &lt;http://stad.gent/news/&gt;
WHERE {
?news item a schema:NewsArticle;
schema:articleBody ?content;
schema:headline ?title;
schema:datePublished ?publication date.
BIND(IRI(replace(STR(?news item),"/id/","/data/")) AS ?subjectpage) 
} ORDER BY DESC(?date of publication) LIMIT 20

The mapping of the hay removal of clays in the municipality of Juillac in the Gers department is extracted from the departmental mapping from the BRGM. This mapping is a zoning of the probability of occurrence of the phenomenon of shrink-inflating of clay soils. A susceptibility map was first drawn up on the basis of purely physical criteria by the BRGM from the geological maps of the department, which were interpreted taking into account the following factors for each geological formation:
— the proportion of clay material within the formation (lithic analysis);
— the proportion of blowing minerals in the clay phase (mineralogical composition);
— the geotechnical behavior of the material. 
For each of the clay formations identified, the hazard level is ultimately the result of the level of susceptibility thus obtained with the density of sinister swelling, reported to 100 km² of actual urbanised outcropping surface.

