La cartographie de l'aléa retrait gonflement des argiles sur la commune de Boucagnères dans le département du Gers est extraite de la cartographie départementale issue du BRGM. Cette cartographie constitue un zonage de la probabilité d'occurrence du phénomène de retrait-gonflement des terrains argileux. Une carte de susceptibilité a d'abord été établie sur la base de critères purement physiques par le BRGM à partir des cartes géologiques du département, qui ont été interprétées en prenant en compte les facteurs suivants pour chaque formation géologique :
- la proportion de matériau argileux au sein de la formation (analyse lithologique) ;
- la proportion de minéraux gonflants dans la phase argileuse (composition minéralogique) ;
- le comportement géotechnique du matériau.
Pour chacune des formations argileuses identifiées, le niveau d’aléa est en définitive la résultante du niveau de susceptibilité ainsi obtenu avec la densité de sinistres retrait gonflement, rapportée à 100 km2 de surface d'affleurement réellement urbanisée.

