For the implementation of the human resources management policy in the bodies of the state administration, for the calculation of salaries and other obligations of the employer and for deciding on rights and obligations arising from employment relationships, the central personnel records of the state administration are kept on the basis of Article 46 of the ZJU. In the case of a civil servant, the following shall be kept in the central personnel register: 
1. identification data (name and surname, address of residence and EMŠO); 
2. data on the employment relationship (type of employment relationship — fixed or permanent; the date on which the employment relationship was entered into); 
3. information on the current position(s) and previous positions or positions in the authorities; 
4. details of appointments, promotions and valid title; 
5. data on the level of education, functional and specialised knowledge, participation in various forms of upskilling and training and on professional examinations and tests taken, and other data on professional competence; 
6. information on experience in European affairs; 
7. information on previous employment relationships, length of service, pension periods and length of service; 
8. information on the performance of functions, on participation in project teams and on the performance of other work in the interest of the employer; 
9. data on the annual estimates; 
10. information on recognitions and prizes; 
11. details of the final determination of disciplinary and liability for damages; 
12. information on the definitive finding of incompetence; 
13. information on termination of employment; 
14. a short curriculum vitae, if the civil servant so wishes or agrees; 
15. security clearance information; 
16. the data necessary for the calculation of the salary, and
17. other information in accordance with the law.

This dataset presents 100 emblematic sites of sports heritage in Île-de-France. It was commissioned by the Region from the Manufacture du patrimoine, which worked there from autumn 2023 to May 2024.

The data concern the eight departments of the Ile-de-France region, with a focus on two singular departments in the history of sport: Paris and Seine-Saint-Denis and at Olympic competition or training venues (1900, 1924, 2024). 

Sports facilities are divided into families (type column): swimming pools, gymnasiums, stadiums, speed or running architectures, skating rinks, natural sports architectures.

For 40 years, other sites have been studied and are available on [inventory.iledefrance.fr](https://inventory.iledefrance.fr) Other photos are available on [phototheque-patrimoine.iledefrance.fr](https://phototheque-patrimoine.iledefrance.fr) These two sites are regularly enriched.

The dataset shall include in particular:

* the exact location of the property with access information by public transport;
* information on the owner;
* historical information on the architectural programme (project, rehabilitation or possible transformation) and the detailed history of the building;
* some buildings benefit from heritage recognition: historical monument, label "Remarkable contemporary architecture", label "Heritage of regional interest" (columns Protection and Justification of the selection).

