Post rendered obsolete (Article L 174-3 of the Urban Planning Code). Back to the RNU since 27/03/2017.
The regulated zoning of the land use plan (POS) is digitised in accordance with the national requirements of the CNIG.
In a SOP there are two main types of restricted zones: urban areas (U) and natural areas (N). These areas shall be demarcated on one or more graphic documents. A regulation is attached to each area. The by-law may lay down different rules, depending on whether the purpose of the construction relates to housing, hotel accommodation, offices, commerce, crafts, industry, agricultural or forestry operations or warehouse functions.
Zones U and N are themselves divided according to existing or future developments.
Thus in urban areas:
— the UA areas indicate ancient urbanisation and dense tissue;
— the UB areas a recent urbanisation with mainly collective housing;
— UC areas a recent urbanisation but with pavilion habitat;
— the UJ zones the various areas of activity of the municipality.
With regard to natural areas:
— the NA areas are referred to as future urbanisation, i.e. they can be developed at a later stage;
— NB areas are natural areas partially serviced by equipment and in which constructions exist, but no further development is planned;
— NC zones represent natural areas protected because of the agricultural value of the land or the richness of the soil or/or subsoil; 
finally, the ND areas are natural areas to protect either the quality of the sites or because there are nuisances or risks.

The table L_DOCUMENT_URBANISME_075 delimits the scope of application of the Paris local urban plan and the plans for safeguarding and enhancing the Marais and the 7th arrondissement. Although it is not strictly speaking an urban planning document, it also identifies the heritage of the Luxembourg Garden, in which the planning rules are not laid down by any of the three documents mentioned above but by the competent authorities of the Senate. 
In Paris, urban planning regulations are governed by three enforceable documents:
— The Local Urban Planning Plan (LUP) of the City of Paris, succeeding the land use plan, approved by a deliberation of the Paris Council of 12 and 13 June 2006.
It applies throughout Paris, including the Bois de Boulogne and Vincennes, with the exception of the two sectors safeguarded and the Garden of Luxembourg;
— The conservation and enhancement plan (PSMV) of the remarkable heritage site of the Marais (parts of the 3 rd and 4th arrondissements), approved by interministerial decree of 23 August 1996 and revised by Prefectural Decree No. 2013352 of 18 December 2013;
— The conservation and enhancement plan (PSMV) of the remarkable heritage site of the 7th arrondissement (part of the 7th arrondissement), approved by interministerial decree of 26 July 1991 and revised by Prefectural Order No. 75-2016-08-09-002 of August 9, 2016.
 The perimeter corresponding to the heritage of the Luxembourg Garden, managed by the Senate, falls under Article 76 of Law No 2003-590 of 2 July 2003 on urban planning and housing (the planning rules are laid down by the competent authorities of the Senate). The table L_DOCUMENT_URBANISME_075 delimits the scope of application of the Paris local urban plan and the plans for safeguarding and enhancing the Marais and the 7th arrondissement.Although it is not strictly speaking an urban planning document, it also identifies the heritage of the Luxembourg Garden, in which the planning rules are not laid down by any of the three documents mentioned above but by the competent authorities of the Senate.

