 — The conservation and enhancement plan (PSMV) of the remarkable heritage site of the Marais (parts of the 3 rd and 4th arrondissements), approved by interministerial decree of 23 August 1996 and revised by Prefectural Decree No. 2013352 of 18 December 2013;

— The conservation and enhancement plan (PSMV) of the remarkable heritage site of the 7th arrondissement (part of the 7th arrondissement), approved by interministerial decree of 26 July 1991 and revised by Prefectural Order No. 75-2016-08-09-002 of August 9, 2016.

