For natural PPRs, the Environmental Code defines two categories of zones (L562-1): risk-exposed areas and areas that are not directly exposed to risks but where measures can be foreseen to avoid exacerbating the risk.Depending on the hazard level, each area is subject to an enforceable settlement. The regulations generally distinguish three types of zones:
1- ‘Building prohibited areas’, known as ‘red areas’, where the hazard level is high and the general rule is the prohibition on construction;
2- ‘prescribed areas’, known as ‘blue zones’, where the hazard level is average and the projects are subject to requirements adapted to the type of issue;
3- areas not directly exposed to risks but where constructions, works, developments or farms, agricultural, forestry, craft, commercial or industrial could aggravate risks or cause new ones, subject to prohibitions or requirements (cf. article L562-1 of the Environmental Code). The latter category applies only to natural RPPs.

The Urban Planning Code defines two types of areas for municipal maps: construction sectors and inconstructible sectors. There are, however, special cases in which graphical documents:
— may define areas reserved for industrial or craft activities, in particular those incompatible with the neighbourhood of inhabited areas;
— define, where appropriate, areas in which the reconstruction of a building destroyed by a disaster is not permitted;
— indicate areas where the facilities necessary for public facilities, agricultural or forestry operations and the development of natural resources are not covered by the principle of inconstructibility resulting from classification.
The areas of the communal map do not always cover the entire communal territory. The areas of the municipality not covered by a sector are represented by an object in order to cover the whole municipality.

