- périmètre d'exposition aux risques qui correspond au périmètre réglementé par le PPR approuvé. Ce périmètre approuvé vaut servitude d'utilité publique (PM1 pour les PPRN et PM3 pour les PPRT) ;
périmètre d'étude qui correspond à l'enveloppe dans laquelle ont été étudiés les aléas.

Regulatory zoning of the PPRN flooding of the commune of Céran in the department of Gers.
For PPRIs, the Environmental Code defines two categories of zones (L562-1): risk-exposed areas and areas that are not directly exposed to risks but where measures can be foreseen to avoid exacerbating the risk. Depending on the hazard level, each area is subject to an enforceable settlement. 
The regulations generally distinguish two types of zones: 
1- ‘Building prohibited areas’, known as ‘red areas’, where the hazard level is high and the general rule is the prohibition on construction;
2- ‘prescribed areas’, known as ‘blue zones’, where the hazard level is average and the projects are subject to requirements adapted to the type of issue;
3- areas not directly exposed to risks but where constructions, works, developments or farms, agricultural, forestry, craft, commercial or industrial could aggravate risks or cause new ones, subject to prohibitions or requirements (cf. Article L562-1 of the Environmental Code). The latter category applies only to natural RPPs.

The mapping of the hay removal of clays in the commune of Castéra-Verduzan in the Gers department is extracted from the departmental mapping from the BRGM. This mapping is a zoning of the probability of occurrence of the phenomenon of shrink-inflating of clay soils. A susceptibility map was first drawn up on the basis of purely physical criteria by the BRGM from the geological maps of the department, which were interpreted taking into account the following factors for each geological formation:
— the proportion of clay material within the formation (lithic analysis);
— the proportion of blowing minerals in the clay phase (mineralogical composition);
— the geotechnical behavior of the material. 
For each of the clay formations identified, the hazard level is ultimately the result of the level of susceptibility thus obtained with the density of sinister swelling, reported to 100 km² of actual urbanised outcropping surface.

