3- areas not directly exposed to risks but where constructions, works, developments or farms, agricultural, forestry, craft, commercial or industrial could aggravate risks or cause new ones, subject to prohibitions or requirements (cf. Article L562-1 of the Environmental Code). The latter category applies only to natural RPPs.

This dataset contains the boundaries at the different stages of the development of the PPRN. The characteristic of these perimeters is to be the consequence of an official act and to produce their effects from a specified date. This is the following:
— prescribed scope contained in the prescription order of a PPR (natural or technological);
— scope of risk exposure that corresponds to the scope regulated by the approved RPP. This approved perimeter is a utility easement (PM1 for PPRNs and PM3 for PPRTs); 
— scope of study which corresponds to the envelope in which the hazards were studied.

